import React, { useState } from 'react';
import './prev.css';
import Snackbar, { SnackbarOrigin } from '@mui/material/Snackbar';
import {
  TableBody,
  TableCell,
  TableRow,
  TableHead,
  TableContainer,
  Table,
  Paper
} from '@mui/material';


export default function Preview() {
 
  return (
    <>
      <div className='preview'>
        <Snackbar
          open={true}
          sx={{ height: '0%' }}
          anchorOrigin={{
            vertical: 'top',
            horizontal: 'center',
          }}
          position='top'
          autoHideDuration={6000}
          message='Workout is added successfully'
        />
        
        <div className='workoutdata'>
          <h1>Workout Preview</h1>
        </div>
      </div>
      
        <div className='tabel'>
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 600 }} size="small" aria-label="a dense table" postion>
            <TableHead>
              <TableRow
                style={{ backgroundColor: 'burlywood', color: 'blue' }}
              >
                <TableCell>Exercise Name</TableCell>
                <TableCell>Sets</TableCell>
                <TableCell>Reps</TableCell>
                <TableCell>Unit</TableCell>
                <TableCell>Date</TableCell>
              </TableRow>
            </TableHead>
            {/* <TableBody>
                {finalData.map((data) =>(
                    <TableRow key = {data.email}>
                        <TableCell>{data.exercisename}</TableCell>
                        <TableCell>{data.sets}</TableCell>
                        <TableCell>{data.reps}</TableCell>
                        <TableCell>{data.units}</TableCell>
                        <TableCell>{data.date}</TableCell>
                    </TableRow>
                ))}
            </TableBody> */}
          </Table>
        </TableContainer>
        </div>
    </>
  );
}
